    return(
        <div>
            <h1>Bem-vindo</h1>
            <div> {props.currentDate} </div>
            <pre> {props.repos.map(
                repo => {
                    return(
                        <div>
                            <h3> {repo.full_name} </h3>
                            <p> Language: {repo.language} </p>
                        </div>
                    )
                }
            )} </pre>
        </div>
    )
}
